import React from "react";
import "../css/Logo.css";

export const Logo = ({
  alt,
  src,
  spinSpeed
}) => {
  return (
    <div className={`logo-container ${spinSpeed}`}>
      <svg>
        <use href={src} />
      </svg>
    </div>
  );
};
